import * as S from './Hamburger.style';

// icons
import { Menu, Cancel } from '../../components/common/icons';

type HamburgerProps = {
  openNav: boolean;
  setOpenNav: React.Dispatch<React.SetStateAction<boolean>>;
};

function Hamburger({ setOpenNav }: HamburgerProps) {
  const HandleMenuClick = () => {
    console.log('hello');
    setOpenNav((pre) => !pre);
  };

  return (
    <S.Hamburger onClick={HandleMenuClick}>
      <Menu />
      <Cancel />
    </S.Hamburger>
  );
}

export default Hamburger;
